import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import './App.css';
import HomePage from './pages/HomePage';
import WorkingComputers from './pages/WorkingComputers';
import NonWorkingComputers from './pages/NonWorkingComputers';

// Main App component
function App() {
  return (
    <div className="app">
      <Routes>
        <Route path="/" element={<HomePage />} />
        <Route path="/working" element={<WorkingComputers />} />
        <Route path="/non-working" element={<NonWorkingComputers />} />
      </Routes>
    </div>
  );
}

// Wrapper component to provide router context
const AppWrapper = () => {
  return (
    <Router>
      <App />
    </Router>
  );
};

export default AppWrapper;
